import React from "react";
import "./App.css";
import Header from "./components/Header";
import Footer from "./components/Footer";

const App = () => {
  return (
    <div className="App">
      <Header />
      <div style={{ height: "10000px" }}></div>
      <Footer />
    </div>
  );
};

export default App;
